import { Component } from '@angular/core';
import { Cart } from '../cart';
import { Router } from '@angular/router';
import { LoginService } from '../login.service';
import { CartService } from '../cart.service';

@Component({
  selector: 'app-user-cart',
  templateUrl: './user-cart.component.html',
  styleUrls: ['./user-cart.component.css']
})
export class UserCartComponent {
  userId!:number|undefined;
  cart: Cart[]=[];

  constructor(private router:Router,private loginservice:LoginService,private cartservice:CartService)
  { this.userId=this.loginservice.getUserLogin()?.user_id; }  

  ngOnInit() {
    this.cartservice.getCartItems(this.userId).subscribe(data => {
      this.cart = data;
    });
  }

  private getUserId(){
    this.cartservice.getCartItems(this.userId).subscribe(data => {
      this.cart = data;
    });
  }
}
